import "./App.css";

function App() {
  return (
    <div className="flex h-screen">
      <SideBar />
      <div className="flex flex-col flex-1">
        <Welcome />
        <MoodTracker />
        <Explore />
      </div>
      <div className="flex flex-col">
        <Quote />
        <Music />
      </div>
    </div>
  );
}
function SideBar() {
  return (
    <div className="h-full bg-purple-400 px-5 ">
      <h1>SideBar</h1>
    </div>
  );
}
function Welcome() {
  return (
    <div className="py-5 px-2 bg-pink-400 h-1/5 ">
      <h1>Welcome Yashika!</h1>
    </div>
  );
}
function MoodTracker() {
  return (
    <div className="bg-green-300 h-1/5">
      <h1>Mood Tracker!</h1>
    </div>
  );
}

function Quote() {
  return (
    <div className="bg-yellow-300 h-1/2 ">
      <h1>Quote</h1>
    </div>
  );
}
function Music() {
  return (
    <div className="bg-pink-100 h-1/2 ">
      <h1>Music</h1>
    </div>
  );
}
function Explore() {
  return (
    <div className="bg-blue-200 h-screen">
      <h1>Explore Today!!</h1>
    </div>
  );
}
export default App;
